import "./../styles/NotePreview.css";


export default function NotePreview() {
  return (
    <>
      <div className="notePreview-container">
        <div className="note-title">
          title
        </div>
        <div className="date">
          date
        </div>
        <div className="preview">
          preview
        </div>
      </div>
    </>
  );
}
